import { lazy } from 'react'

const EcrRoutes = [
  {
    path: '/ecr/create-ecr',
    component: lazy(() => import('../../views/pages/ecr/index'))
  },
  {
    path: '/ecr/add_ecr',
    component: lazy(() => import('../../views/pages/ecr/index'))
  }
]

export default EcrRoutes
